import React from 'react';
import { useNavigate } from 'react-router-dom';
import './Navbar.css';

const Navbar = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    localStorage.removeItem('token');
    navigate('/');
  };

  return (
    <div className="navbar">
      <button className="nav-button" onClick={() => navigate('/experts')}>Expert Registration</button>
      <button className="nav-button" onClick={() => navigate('/doctors')}>Doctor Registration</button>
      <button className="nav-button" onClick={() => navigate('/dsps')}>DSP Registration</button>
      <button className="nav-button" onClick={() => navigate('/workplaces')}>Workplace Registration</button>
      <button className="nav-button" onClick={() => navigate('/accounting')}>Accounting</button>
      <button className="nav-button" onClick={() => navigate('/data')}>Data Import</button>
      <button className="nav-button" onClick={handleLogout}>Logout</button>
    </div>
  );
};

export default Navbar;
